function openBranch(evt, branchName, toggleView) {
        var i, tabcontent, tablinks;

        tabcontent = document.getElementsByClassName("tabcontent");
        for (i = 0; i < tabcontent.length; i++) {
            tabcontent[i].style.display = "none";
        }

        tablinks = document.getElementsByClassName("tablinks");
        for (i = 0; i < tablinks.length; i++) {
            tablinks[i].className = tablinks[i].className.replace(" active", "");
        }

        document.getElementById(branchName).style.display = "block";
        evt.currentTarget.className += " active";
        document.getElementById(toggleView).click();
}

function openTab(evt, tabName) {
    var i, tabcontent, tablinks;

    tabcontent = document.getElementsByClassName("tabcontent");
    for (i = 0; i < tabcontent.length; i++) {
        tabcontent[i].style.display = "none";
    }

    tablinks = document.getElementsByClassName("tablinks");
    for (i = 0; i < tablinks.length; i++) {
        tablinks[i].className = tablinks[i].className.replace(" active", "");
    }

    document.getElementById(tabName).style.display = "block";
    evt.currentTarget.className += " active";
    
}

function toggleView(evt, branchName) {
    var i, tabcontent, tablinks;

    tabcontent = document.getElementsByClassName("togglecontent");
    for (i = 0; i < tabcontent.length; i++) {
        tabcontent[i].style.display = "none";
    }

        
    tablinks = document.getElementsByClassName("togglelinks");
    for (i = 0; i < tablinks.length; i++) {
        tablinks[i].className = tablinks[i].className.replace(" active", "");
    }

    document.getElementById(branchName).style.display = "block";
    evt.currentTarget.className += " active";
    evt.preventDefault();
}
;
var SalesChart = {
    init: function(){ 

    $('#from').datepicker({}).on('change', function(){
        if($(this).val() === '' || $(this).val() > $('#to').val())
            {   $('#to').val('')    }
        else {
                dfrom = $(this).val();
                dto = $('#to').val();
                $('#sales-chart').addClass('blurry');           
                new Chartkick.LineChart('sales-chart', '/charts/daily_sales?from='+dfrom+'&to='+dto, {"colors":["#DC143C","#FF4500","#60355B","#DC143C","#FF8C00"],"min":100,"max":100000})
                $.ajax({
                    url: '/charts/get_dates?from='+dfrom+'&to='+dto,
                    method: 'GET',
                    success: (data) => {
                        $('#sales-label').text(data.label);
                        $('#average-per-date').text(data.title);                     
                        $('#reset').show(); 
                    }
                });

                $.ajax({
                    url: '/charts/get_average?from='+dfrom+'&to='+dto,
                    method: 'GET',
                    success: (data) => {
                    $('#sales-chart').removeClass('blurry');
                    $.each(data.branches, function(i, branch){
                            $('td#'+branch.reverse).text(branch.average)
                            if(branch.status === "Good"){
                                $('td#'+branch.reverse).addClass("fine");
                                $('td#'+branch.reverse).removeClass("fail");
                            }else if(branch.status === "Unwell"){
                                $('td#'+branch.reverse).addClass("fail");
                                $('td#'+branch.reverse).removeClass("fine");
                            }else{
                                $('td#'+branch.reverse).removeClass("fine");
                                $('td#'+branch.reverse).removeClass("fail");
                            }
                        })
                    }
                })
        }
    });

    $('#to').datepicker({}).on('change',function(){

        if($(this).val() === '' || $('#from').val() === '' || $(this).val() < $('#from').val())
            { 
                alert("Please make sure your 'From' field has value and less than the other.")
                $(this).val('');
            }
        else {    
            dfrom = $('#from').val();
            dto = $(this).val();
            name = $('.branch').text()
            $('.centered').addClass('show');
            $('#sales-chart').addClass('blurry');           
            new Chartkick.LineChart('sales-chart', '/charts/daily_sales?from='+dfrom+'&to='+dto, {"colors":["#DC143C","#FF4500","#60355B","#DC143C","#FF8C00"],"min":100,"max":100000})                                                       
            $.ajax({
                url: '/charts/get_dates?from='+dfrom+'&to='+dto,
                method: 'GET',
                success: (data) => {
                    $('#sales-label').text(data.label);
                    $('#average-per-date').text(data.title);                     
                    $('#reset').show(); 
                }
            });
            
            $.ajax({
                url: '/charts/get_average?from='+dfrom+'&to='+dto,
                method: 'GET',
                success: (data) => {
                $.each(data.branches, function(i, branch){
                    $('.centered').removeClass('show');
                    $('#sales-chart').removeClass('blurry');   
                        $('td#'+branch.reverse).text(branch.average)
                        if(branch.status === "Good"){
                            $('td#'+branch.reverse).addClass("fine");
                            $('td#'+branch.reverse).removeClass("fail");
                        }else if(branch.status === "Unwell"){
                            $('td#'+branch.reverse).addClass("fail");
                            $('td#'+branch.reverse).removeClass("fine");
                        }else{
                            $('td#'+branch.reverse).removeClass("fine");
                            $('td#'+branch.reverse).removeClass("fail");
                        }
                    })
                }
            })
        }        
        
    });

    $('#reset').on('click',function(){
        new Chartkick.LineChart("sales-chart", "/charts/daily_sales", {"colors":["#DC143C","#FF4500","#60355B","#DC143C","#FF8C00"],"min":100,"max":100000});               
        $('#average-per-date').text('Average Sales Per Date Range (Current Week)')
        $('#reset').hide();
        $('#to').val('');
        $('#from').val(''); 
        $('#sales-chart').addClass('blurry');
        $.ajax({
            url: '/charts/get_average',
            method: 'GET',
            success: (data) => {
            $.each(data.branches, function(i, branch){
                    $('td#'+branch.reverse).text(branch.average)
                    if(branch.status === "Good"){
                        $('td#'+branch.reverse).addClass("fine");
                        $('td#'+branch.reverse).removeClass("fail");
                    }else if(branch.status === "Unwell"){
                        $('td#'+branch.reverse).addClass("fail");
                        $('td#'+branch.reverse).removeClass("fine");
                    }else{
                        $('td#'+branch.reverse).removeClass("fine");
                        $('td#'+branch.reverse).removeClass("fail");
                    }
                })
            }
        })
        $.ajax({
            url: 'charts/get_dates',
            method: 'GET',
            success: (data) => {
                $('#sales-label').text(data.title)
                $('#sales-chart').removeClass('blurry');
            }
        })
    })
    }
}

$(document).ready(SalesChart.init)
$(document).on('turbolinks:load', SalesChart.init)
    
